import React, { useEffect, useState } from "react";
import { RouteComponentProps, withRouter } from "react-router";
import { Container } from "../components/Container";
import { Table } from "react-bootstrap";

type ProfileParams = {
  id: string;
};
type ProfileProps = RouteComponentProps<ProfileParams>;

const Profile: React.FC<ProfileProps> = ({ match }) => {
  useEffect(() => {
    fetchItem();
  }, []);

  const [item, setItem] = useState({
    id: Number,
    name: String,
    username: String,
    email: String,
    address: {
      street: String,
      suite: String,
      city: String,
      zipcode: Number,
      geo: {
        lat: Number,
        lng: Number,
      },
    },
    phone: Number,
    website: String,
    company: {
      name: String,
      catchPhrase: String,
      bs: String,
    },
  });

  const fetchItem = async () => {
    const fetchItem = await fetch(
      `https://jsonplaceholder.typicode.com/users/${match.params.id}`
    );
    const item = await fetchItem.json();
    setItem(item);
    // console.log(item);
    // const result = await axios("https://jsonplaceholder.typicode.com/users/1");
    // setdataProfile(result);
    // console.log(result.data);
  };
  console.log(item.id);

  return (
    <div>
      <Container>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>#</th>
              <th>Name</th>
            </tr>
          </thead>

          <tbody>
            <tr>
              <td>name</td>
              <td>{item.name}</td>
            </tr>
            <tr>
              <td>username</td>
              <td>{item.username}</td>
            </tr>
            <tr>
              <td>email</td>
              <td>{item.email}</td>
            </tr>
            <tr>
              <td>Albul</td>
              <td>...</td>
            </tr>
          </tbody>
        </Table>

        {/* <div>Book ID: {match.params.id}</div>
        <div>{item.id}</div>
        <div>{item.name}</div>
        <div>{item.username}</div>
        <div>{item.email}</div>
        <div>{item.phone}</div>
        <div>{item.website}</div>
        <div>Adress:</div>
        {item.address.street}
        {item.address.suite}
        {item.address.city}
        {item.address.zipcode}
        <div>Latitude: {item.address.geo.lat}</div>
        <div>Longetude: {item.address.geo.lng}</div>
        <div>Compagni:</div>
        <div>{item.company.name}</div>
        <div>{item.company.catchPhrase}</div>
        <div>{item.company.bs}</div> */}
      </Container>
    </div>
  );
};
export default withRouter(Profile);
